$name = 'Harsh';
echo $name;
`,
    cpp: `
#include <iostream>
using namespace std;

int main()
{
	cout << "Hello World!!";

	return 0;
}`,
    c: `
#include <stdio.h>

int main() {
	printf("Hello World!!");
	return 0;
}
`,
    dart: `
